import amazonas from '../assets/piscinas fibratec/amazonas.png'

const images = [
    {
      label: 'Modelo – Amazonas',
      imgPath: '../assets/piscinas fibratec/amazonas.png'
    },
    {
      label: 'Modelo – Ipanema',
      imgPath:
      '../assets/piscinas fibratec/ipanema.png',
    },
    {
      label: 'Modelo – Mediterrânea',
      imgPath:
      '../assets/piscinas fibratec/mediterranea.png'    },
    {
      label: 'Modelo – SPA Diamante',
      imgPath:
      '../assets/piscinas fibratec/spaDiamante.png'    },
    {
        label: 'Modelo – SPA Ilha Redonda',
        imgPath:
        '../assets/piscinas fibratec/spaIRedonda.png'      },
      {
        label: 'Modelo – Suprema',
        imgPath:
        '../assets/piscinas fibratec/suprema.png'      },
  ];


  export default images
